import React, { useState } from "react";
import { Link } from "react-router-dom";
import { FaBars, FaTimes, FaMoon, FaSun, FaUser, FaBookOpen, FaGlobe, FaStore, FaComments, FaSearch, FaNewspaper } from "react-icons/fa";

const Navbar = () => {
  const [darkMode, setDarkMode] = useState(localStorage.getItem("darkMode") === "true");
  const [menuOpen, setMenuOpen] = useState(false);
  const [horoscopeDropdown, setHoroscopeDropdown] = useState(false);

  const handleDarkMode = () => {
    setDarkMode(!darkMode);
    document.documentElement.classList.toggle("dark", !darkMode);
    localStorage.setItem("darkMode", !darkMode);
  };

  return (
    <nav className="fixed top-0 left-0 w-full z-50 bg-white/30 dark:bg-gray-900/40 backdrop-blur-lg shadow-lg border-b border-white/20 dark:border-gray-800/50">
      <div className="max-w-7xl mx-auto px-6 flex justify-between items-center py-4">
        {/* Logo */}
        <Link to="/" className="text-3xl font-bold text-yellow-500 transition hover:scale-105">
          🔮 AstroSphere
        </Link>

        {/* Desktop Menu */}
        <ul className="hidden md:flex space-x-6 text-gray-700 dark:text-white font-medium">
          <li><Link to="/" className="hover:text-yellow-400 transition flex items-center"><FaBookOpen className="mr-2" /> Free Kundli</Link></li>
          <li><Link to="/kundli-matching" className="hover:text-yellow-400 transition flex items-center">💞 Kundli Matching</Link></li>

          {/* Horoscope Dropdown */}
          <li className="relative">
            <button onClick={() => setHoroscopeDropdown(!horoscopeDropdown)} className="hover:text-yellow-400 transition flex items-center">
              <FaGlobe className="mr-2" /> Horoscopes ▼
            </button>
            {horoscopeDropdown && (
              <ul className="absolute left-0 mt-2 bg-white dark:bg-gray-800 shadow-md rounded-lg p-2 w-48">
                <li><Link to="/horoscope" className="block px-4 py-2 hover:bg-gray-200 dark:hover:bg-gray-700 rounded-md">Daily Horoscope</Link></li>
                <li><Link to="/horoscope?weekly" className="block px-4 py-2 hover:bg-gray-200 dark:hover:bg-gray-700 rounded-md">Weekly Horoscope</Link></li>
              </ul>
            )}
          </li>

          <li><Link to="/chat-astrologer" className="hover:text-yellow-400 transition flex items-center"><FaComments className="mr-2" /> Chat with Astrologer</Link></li>
          <li><Link to="/talk-astrologer" className="hover:text-yellow-400 transition flex items-center">📞 Talk to Astrologer</Link></li>

          <li>
            <Link to="/book-pooja" className="hover:text-yellow-400 transition flex items-center relative">
              🙏 Book a Pooja <span className="bg-yellow-500 text-black text-xs font-bold ml-2 px-2 py-1 rounded-full">NEW</span>
            </Link>
          </li>

          <li><Link to="/astromall" className="hover:text-yellow-400 transition flex items-center"><FaStore className="mr-2" /> Astromall</Link></li>
          <li><Link to="/astrotalk-store" className="hover:text-yellow-400 transition flex items-center">🛍️ Astrotalk Store</Link></li>
          <li><Link to="/blog" className="hover:text-yellow-400 transition flex items-center"><FaNewspaper className="mr-2" /> Blog</Link></li>
        </ul>

        {/* Dark Mode & Login */}
        <div className="flex items-center space-x-4">
          <button onClick={handleDarkMode} className="text-gray-700 dark:text-white text-lg transition">
            {darkMode ? <FaSun /> : <FaMoon />}
          </button>
          <button className="px-4 py-2 bg-yellow-500 text-black rounded-full hover:bg-yellow-600 transition flex items-center">
            <FaUser className="mr-2" /> Login
          </button>
        </div>

        {/* Mobile Menu Button */}
        <button className="md:hidden text-gray-700 dark:text-white text-2xl" onClick={() => setMenuOpen(!menuOpen)}>
          {menuOpen ? <FaTimes /> : <FaBars />}
        </button>
      </div>

      {/* Mobile Menu */}
      {menuOpen && (
        <ul className="md:hidden bg-white dark:bg-gray-900 shadow-md p-4 text-center">
          <li><Link to="/" className="block py-2 hover:text-yellow-400">Free Kundli</Link></li>
          <li><Link to="/kundli-matching" className="block py-2 hover:text-yellow-400">Kundli Matching</Link></li>
          <li><Link to="/horoscope" className="block py-2 hover:text-yellow-400">Daily Horoscope</Link></li>
          <li><Link to="/horoscope?weekly" className="block py-2 hover:text-yellow-400">Weekly Horoscope</Link></li>
          <li><Link to="/chat-astrologer" className="block py-2 hover:text-yellow-400">Chat with Astrologer</Link></li>
          <li><Link to="/talk-astrologer" className="block py-2 hover:text-yellow-400">Talk to Astrologer</Link></li>
          <li><Link to="/book-pooja" className="block py-2 hover:text-yellow-400">Book a Pooja <span className="bg-yellow-500 text-black text-xs font-bold ml-2 px-2 py-1 rounded-full">NEW</span></Link></li>
          <li><Link to="/astromall" className="block py-2 hover:text-yellow-400">Astromall</Link></li>
          <li><Link to="/astrotalk-store" className="block py-2 hover:text-yellow-400">Astrotalk Store</Link></li>
          <li><Link to="/blog" className="block py-2 hover:text-yellow-400">Blog</Link></li>
        </ul>
      )}
    </nav>
  );
};

export default Navbar;
